import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AcceuilComponent } from './acceuil/acceuil.component';
import { CliniqueComponent } from './clinique/clinique.component';
import { ConseilComponent } from './conseil/conseil.component';
import { ContactComponent } from './contact/contact.component';
import { DocteurComponent } from './docteur/docteur.component';
import { FACComponent } from './fac/fac.component';
import { FooterComponent } from './footer/footer.component';
import { RealisationComponent } from './realisation/realisation.component';
import { TemoignagesComponent } from './temoignages/temoignages.component';

const routes: Routes = [
  { path: '', component: AcceuilComponent},
  { path: 'clinique', component: CliniqueComponent},
  { path: 'fac', component: FACComponent},
  { path: 'realisation', component: RealisationComponent},
  { path: 'temoignages', component: TemoignagesComponent},
  { path: 'conseil', component: ConseilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'acceuil', component: AcceuilComponent},
  { path: 'contact', component: ContactComponent},
  { path: '', component: FooterComponent }

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
